class Solution {
public:

    void solve(ll index) {
        //----------------------------------------------------------------------------------

        // debug("Case #", index, ": ", newl);
        ll n, i, j, k, r;
        cin >> n >> r;
        if (r == 0) {
            cout << 1 << newl;
            vecll temp(n, 1);
            cout << temp << newl;
            return;
        }
        vecprll pairs(r);
        cin >> pairs;
        sort(all(pairs));
        ll ans = pairs[0].S - pairs[0].F + 1;
        ll prev = pairs[0].S;
        fri(i, 1, pairs.size()) {
            if (pairs[i].F <= prev && pairs[i].S > prev) {
                ll cou = prev - pairs[i].F + 1;
                ll val = ans - cou;
                ll diff = pairs[i].S - prev;
                if (diff > val) {
                    ans += diff - val;
                }
            }
        }
        vecll ansvec(n, -1);
        vecll stuff;
        for (int i = 1;i <= ans;++i) {
            stuff.pb(i);
        }
        ll inx = 0;
        fri(i, pairs[0].F, pairs[0].S + 1) {
            ansvec[inx] = stuff[inx];
            inx = (inx + 1) % ans;
        }
        fri(i, 1, pairs.size()) {
            if (pairs[i].F <= prev && pairs[i].S > prev) {
                fri(j, prev, pairs[i].S + 1) {
                    if(ansvec[inx]==-1) {
                        ansvec[inx] = stuff[inx];
                        inx = (inx + 1) % ans;
                    }
                }
            }
        }
        fri(i, 0, ansvec.size()) {
            if (ansvec[i] == -1) {
                ansvec[i] = 1;
            }
        }
        cout << ans << newl;
        cout << ansvec << newl;

        // cout<<"Case #"<<index<<": "<<ans<<newl;

        //----------------------------------------------------------------------------------
    }

    bool test_cases = true;
};
